import React, { useState, useEffect } from 'react';
import './ProductsPage.css';

// Временные данные, пока не подключен бэкенд
const mockProducts = [
  { id: 1, name: 'Куриная грудка', calories: 165, protein: 31, fat: 3.6, carbs: 0 },
  { id: 2, name: 'Гречка', calories: 110, protein: 4.5, fat: 0.6, carbs: 23 },
  { id: 3, name: 'Яйцо', calories: 155, protein: 13, fat: 11, carbs: 1.1 },
  { id: 4, name: 'Творог 5%', calories: 121, protein: 17, fat: 5, carbs: 1.8 },
  { id: 5, name: 'Огурец', calories: 15, protein: 0.7, fat: 0.1, carbs: 3.6 },
];

function ProductsPage() {
  const [products, setProducts] = useState([]);
  const [selectedProducts, setSelectedProducts] = useState([]);
  const [totals, setTotals] = useState({ calories: 0, protein: 0, fat: 0, carbs: 0 });

  useEffect(() => {
    // TODO: Заменить на fetch запрос к бэкенду
    setProducts(mockProducts);
  }, []);

  const handleProductSelect = (product, isSelected) => {
    let newSelected;
    if (isSelected) {
      newSelected = [...selectedProducts, product];
    } else {
      newSelected = selectedProducts.filter(p => p.id !== product.id);
    }
    setSelectedProducts(newSelected);
  };

  useEffect(() => {
    const newTotals = selectedProducts.reduce(
      (acc, product) => {
        acc.calories += product.calories;
        acc.protein += product.protein;
        acc.fat += product.fat;
        acc.carbs += product.carbs;
        return acc;
      },
      { calories: 0, protein: 0, fat: 0, carbs: 0 }
    );
    setTotals(newTotals);
  }, [selectedProducts]);

  return (
    <div className="products-page">
      <h1>Калькулятор калорий</h1>

      <div className="product-list">
        <h2>Список продуктов</h2>
        {products.map(product => (
          <div key={product.id} className="product-item">
            <label>
              <input
                type="checkbox"
                onChange={e => handleProductSelect(product, e.target.checked)}
              />
              {product.name} (100г)
            </label>
          </div>
        ))}
      </div>

      <div className="totals">
        <h2>Ваш результат</h2>
        <table>
          <thead>
            <tr>
              <th>Показатель</th>
              <th>Количество</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>Калории</td>
              <td>{totals.calories.toFixed(2)}</td>
            </tr>
            <tr>
              <td>Белки, г</td>
              <td>{totals.protein.toFixed(2)}</td>
            </tr>
            <tr>
              <td>Жиры, г</td>
              <td>{totals.fat.toFixed(2)}</td>
            </tr>
            <tr>
              <td>Углеводы, г</td>
              <td>{totals.carbs.toFixed(2)}</td>
            </tr>
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default ProductsPage;
